char buf[1024*1024];
void doit() {
  scanf(" %s",buf);
  if (0 == strcmp("END",buf)) exit(0);

  int t = 0;
  string xt = buf,xt1;
  while (xt != xt1) {
    ++t;
    xt1 = xt;
    sprintf(buf, "%d", (int)xt1.size());
    xt = buf;
  }

  printf("%d\n", t);
}

